import './FilterCard.css'

function FilterCard(props) {

  getFilterComponent = () => {
    return (
      <div className='filterCard'>
        <p className='filterId'>{props.id}</p>
        <div className='closeIcon'>
          <i class="fas fa-times"></i>
        </div>
      </div>
    );
  }

  getAdditionComponent = () => {
    return (
      <div className='filterCard'>
        <p className='filterId'>{props.id}</p>
        <div className='closeIcon'>
          <i class="fas fa-times"></i>
        </div>
      </div>
    )
  }

  return props.id ? getFilterComponent() : getAdditionComponent();
}

export default FilterCard;
